  text,
  textColor,
  bgColor,
  IcAfter,
  onClick,
  fullWidth,
}: IButtonProps) => {
  return (
    <button
      type="button"
      className={`py-2 px-4 ${textColor} ${bgColor} ${fullWidth && 'w-full'}
      } outline-none rounded-md hover:underline flex items-center justify-center gap-1`}
      onClick={onClick}
    >
      {text}
      {IcAfter != null && <IcAfter />}
    </button>
  );
};

